import React from 'react';
import ResponsiveNavBar from "../Partials/Header"



function Home() {
  return (
    <div className="flex flex-col min-h-screen overflow-hidden">

      {/*  Site header */}
      <ResponsiveNavBar />

      {/*  Page content */}
      <main className="flex-grow my-6 py-5  drop-shadow-2xl text-black font-sans">

      {/* home section */}
      <div class="relative bg-transparent mx-auto overflow-hidden sm:rounded-2xl">
        <div class="relative max-w-2xl mx-auto text-center py-16 px-4 sm:py-20 sm:px-6 lg:px-8">
          <h1 class="bold text-3xl font-extrabold sm:text-4xl">
          Voyager <span className='border-b-4 border-teal-700'>confortablement</span>, avec des personnes de <span className='border-b-4 border-teal-700'>confiance</span>, et au <span className='border-b-4 border-teal-700'>prix le plus bas</span> !
          </h1>
          <p class="mt-4 text-lg leading-6 ">Ac euismod vel sit maecenas id pellentesque eu sed consectetur. Malesuada adipiscing sagittis vel nulla nec.</p>
          <div class="mt-10 max-w-sm mx-auto sm:max-w-none sm:flex sm:justify-center">
            <div class="space-y-4 sm:space-y-0 sm:mx-auto sm:inline-grid sm:grid-cols-2 sm:gap-5">
              <a href="/" class="text-teal-400 bg-white hover:bg-skin-button-accent-hover flex items-center justify-center px-4 py-3 border border-transparent text-base font-medium rounded-md shadow-sm sm:px-8"> Get started </a>
              <a href="/" class="text-white bg-teal-400 flex items-center justify-center px-4 py-3 border border-transparent text-base font-medium rounded-md shadow-sm bg-opacity-60 hover:bg-opacity-70 sm:px-8"> Live demo </a>
            </div>
          </div>
        </div>
      </div>

        {/*  Page sections */}


      </main>

      {/*  Site footer */}


    </div>
  );
}

export default Home;
